      SELECT DISTINCT 97 / cor1.col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q6902.out
    data: |
      1
      32
